<html>
    <head>
        <script src="pushed.js"></script>
        <script>
const start = Date.now()

function onLoad () {
    const end = Date.now()
    document.title = `${(end - start)}ms`
}
        </script>
    </head>
    <body onload="onLoad()">
        <table>
            <script>
for (let tr = 0; tr < 10; ++tr) {
    document.write('<tr>')
    for (let td = 0; td < 10; ++td) {
        document.write(`<td><img width="100" src="http2-${10 * tr + td}.svg"></td>`)
    }   
    document.write('</tr>')
}
            </script>
        </table>
    </body>
</html>
